import React from 'react';
import 'Scroll.css';
import scroll from "../../image/down.png";

class Scroll extends React.Component{
    constructor(props) {
        super(props);
    }


    render() {
        return (
        <a className="scroll about_scroll" href="#work">
            <img src={scroll} alt=""/>
        </a>
    )
    }

}

export default Scroll;
